con:configuration.scriptText:
def slurper = new groovy.json.JsonSlurper()

def result = slurper.parseText(messageExchange.responseContent)

def username = context.expand( '${Data Source - Excel#username}' )

assert result.user.username ==  username

//Verify the response code
assert messageExchange.responseStatusCode == 200

//Verify the response time
assert messageExchange.timeTaken < 2000

assert messageExchange.responseHeaders['Content-Type'] == ["application/json; charset=utf-8"]

con:config.script:
